import './App.css';

function App() {
  return (
    <div className="App">
      <header className="ISS Tracker">
        <div className='map'>

        </div>

        <p>
          Using leaflet and jquery, one can write a script to show the current location of the ISS and update it every 5 seconds.
        </p>
        <a
          className="App-link"
          href="https://github.com/Kingtim11"
          target="_blank"
          rel="noopener noreferrer"
        >
          Created by Tim King
        </a>
      </header>
    </div>
  );
}

export default App;
